// SPDX-License-Identifier: UNLICENSED
pragma solidity ^0.8.0;
pragma abicoder v2;

import "./Ownable.sol";
import "@openzeppelin/contracts/utils/Counters.sol";

contract Library is Ownable {

    using Counters for Counters.Counter;

//mapping(address => Book)) borrowedBooksMap; //mapping books to address of users 

struct Book {
    string name;
    Counters.Counter id;
}

Book[] public books;
Counters.Counter private id;

function addNewBook (string memory _name) external onlyOwner {
    books.push(Book(_name, id));
    id.increment();
}

function borrowBook () public {

}

function returnBook () public {

}

function seeRecord () public view returns(Book[] memory) {
    return books;
}

}

